import React, { useState, useEffect, useRef } from 'react';
import ChatWindow from './components/ChatWindow';
import AgentAvatar from './components/AgentAvatar';
import './App.css';

const AGENTS = [
  {
    id: 'general',
    name: 'General',
    avatar: 'ðŸ‘¨â€âœˆï¸',
    description: 'General maritime assistance and routing',
    color: '#4A90E2'
  },
  {
    id: 'voyage_planner',
    name: 'Voyage Planner',
    avatar: 'ðŸ§­',
    description: 'Route planning, ETA, fuel optimization',
    color: '#7ED321'
  },
  {
    id: 'cargo_matching',
    name: 'Cargo Matcher',
    avatar: 'ðŸ“¦',
    description: 'Vessel-cargo pairing and profitability',
    color: '#F5A623'
  },
  {
    id: 'market_insights',
    name: 'Market Insights',
    avatar: 'ðŸ“Š',
    description: 'Freight rates, bunker trends, analysis',
    color: '#D0021B'
  },
  {
    id: 'port_intelligence',
    name: 'Port Intelligence',
    avatar: 'âš“',
    description: 'Port information and bunker availability',
    color: '#9013FE'
  },
  {
    id: 'pda_management',
    name: 'PDA Management',
    avatar: 'ðŸ’°',
    description: 'Port disbursement cost estimates',
    color: '#50E3C2'
  }
];

function App() {
  const [messages, setMessages] = useState([]);
  const [isLoading, setIsLoading] = useState(false);
  const [currentAgent, setCurrentAgent] = useState(null);
  const messagesEndRef = useRef(null);

  const scrollToBottom = () => {
    messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
  };

  useEffect(() => {
    scrollToBottom();
  }, [messages]);

  const sendMessage = async (message) => {
    if (!message.trim()) return;

    const userMessage = {
      id: Date.now(),
      text: message,
      sender: 'user',
      timestamp: new Date().toISOString()
    };

    setMessages(prev => [...prev, userMessage]);
    setIsLoading(true);

    try {
      const response = await fetch('/api/chat', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          message: message,
          user_id: 'default'
        }),
      });

      const data = await response.json();
      
      if (data.status === 'success') {
        const agentMessage = {
          id: Date.now() + 1,
          text: data.text,
          sender: 'agent',
          agent: data.agent,
          data: data.data,
          timestamp: new Date().toISOString()
        };

        setMessages(prev => [...prev, agentMessage]);
        setCurrentAgent(data.agent);
      } else {
        const errorMessage = {
          id: Date.now() + 1,
          text: data.text || 'An error occurred. Please try again.',
          sender: 'agent',
          agent: 'General',
          data: data.data,
          timestamp: new Date().toISOString()
        };

        setMessages(prev => [...prev, errorMessage]);
      }
    } catch (error) {
      console.error('Error sending message:', error);
      const errorMessage = {
        id: Date.now() + 1,
        text: 'Sorry, I encountered an error. Please try again.',
        sender: 'agent',
        agent: 'General',
        data: { error: error.message },
        timestamp: new Date().toISOString()
      };

      setMessages(prev => [...prev, errorMessage]);
    } finally {
      setIsLoading(false);
    }
  };

  const clearChat = () => {
    setMessages([]);
    setCurrentAgent(null);
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>ðŸš¢ IME Hub Maritime AI Assistant</h1>
        <p>Your intelligent maritime operations companion</p>
      </header>

      <div className="App-container">
        <div className="agents-sidebar">
          <h3>AI Agents</h3>
          <div className="agents-grid">
            {AGENTS.map(agent => (
              <AgentAvatar
                key={agent.id}
                agent={agent}
                isActive={currentAgent === agent.name}
                onClick={() => setCurrentAgent(agent.name)}
              />
            ))}
          </div>
          <button className="clear-chat-btn" onClick={clearChat}>
            Clear Chat
          </button>
        </div>

        <div className="chat-main">
          <ChatWindow
            messages={messages}
            onSendMessage={sendMessage}
            isLoading={isLoading}
            currentAgent={currentAgent}
          />
        </div>
      </div>

      <div ref={messagesEndRef} />
    </div>
  );
}

export default App;
